import React from "react";
import logo from "./logo.svg";
import Game from "./components/game";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <Game></Game>
    </div>
  );
}

export default App;
